import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="header_menu">
        <div className="container"></div>
         <div className="col-md-6">123</div>
        </header>
      </div>
    );
  }
}

export default App;
